import React, { Component } from "react";
import { Form } from "semantic-ui-react";
import Layout from "../components/Layout";

class newDoc extends Component {
  render() {
    return (
      <Layout>
        <h1>Register Doctor</h1>
        <Form></Form>
      </Layout>
    );
  }
}

export default newDoc;
